n\nThe frequencies are the following:\n\n★ 396 Hertz: DO. It is usually related to guilt and fear, and how they can suppress other emotions as well. It is associated with the color red.\n\n★ 417 Hertz: RE. It is usually related to past trauma and negativity and the willingness to change. This frequency can help you to recognize those past traumas that are no longer valuable in your life. It is associated with the color orange.\n\n★ 528 Hertz: MI. It is usually related to DNA, peace of mind and clarity. This frequency will help you heal and remove any sickness you may have. It is associated with the color yellow.\n\n★ 639 Hertz: FA. It is usually related to Interpersonal relationships. This frequency will help you heal those difficult relationships you still have from the past while also reconnecting with those who are valuable in your present. It is associated with the color green.\n\n★ 741 Hertz: SOL. It is usually related to the emotional stability you are looking for. This frequency will help you solve any problems you may have in your life. It is associated with the color blue.\n\n★ 852 Hertz: LA. It is usually related to the views of oneself and the universe. It requires open space in order to allow intuition to come in. It is associated with the color indigo.\n\n★ 963 Hertz: SI. it is usually related to the feeling of oneness. It means awakening and interconnected to the universe. This frequency helps you to reconnect with yourself. It is associated with the color purple.\n\nAnd this isn’t something new either, as ancient civilizations from all areas of the world seemed to use music as therapy, in all of its forms. The greeks used flutes or lyres, the Mesopotamians used the harp, or the Incas used the flutes (or quena as they are traditionally known).  \n\nChoose a Solfeggio frequency track: Perhaps you would like to start at the beginning? It doesn’t matter, as there isn’t a specific order for them to be played…in fact, you can choose to do one if you would like to focus on that specific frequency for the time being. \n\nMany experience a shift happening after the first couple of seconds of listening. Be consistent with it to truly raise your vibration to cleanse out old unconscious energy that holds one locked in a fear-based reality. \n\nRead more about the healing frequencies on our website:\nwww.tribeofthehealers.com\n\nWe believe in the power of the human spirit,\n- WOKE NATION"}]},"subscribeButton":{"buttonRenderer":{"style":"STYLE_DESTRUCTIVE","size":"SIZE_DEFAULT","isDisabled":false,"text":{"runs":[{"text":"Subscribe"}]},"navigationEndpoint":{"clickTrackingParams":"CJIBEJsrIhMI58e4w7qk6QIVDrJ7Ch0XIwGX","commandMetadata":{"webCommandMetadata":{"ignoreNavigation":true}},"modalEndpoint":{"modal":{"modalWithTitleAndButtonRenderer":{"title":{"simpleText":"Want to subscribe to this channel?"},"content":{"simpleText":"Sign in to subscribe to this channel."},"button":{"buttonRenderer":{"style":"STYLE_BLUE_TEXT","size":"SIZE_DEFAULT","isDisabled":false,"text":{"simpleText":"Sign in"},"navigationEndpoint":{"clickTrackingParams":"CJMBEP2GBCITCOfHuMO6pOkCFQ6yewodFyMBlzIJc3Vic2NyaWJl","commandMetadata":{"webCommandMetadata":{"url":"https://accounts.google.com/ServiceLogin?service=youtube\u0026uilel=3\u0026passive=true\u0026continue=https%3A%2F%2Fwww.youtube.com%2Fsignin%3Faction_handle_signin%3Dtrue%26app%3Ddesktop%26hl%3Den%26next%3D%252Fwatch%253Fv%253DtaJ7Rb3qgi8%26continue_action%3DQUFFLUhqbm5tcVRRenBManlTZzZGek4yMHRpQWhlbmlDQXxBQ3Jtc0ttdU1aQldjdTNsZEpuYzNFdFF2MlRHMmw3REdua0haQ2k2YVp2SUtudk96TThEWnBpX1YwbzE1OFFWYUN3RVFBZDNzOGVtVExqSzJzZXg0T2ZkX0FSci03Vmttdm00dC1WQ2F3UjdGbXZmTXBZbThsQzktaWc1SmljQVBMWFNfS1FOVFlvWDdGVjI5bGhLVnB4VEZ5ZU1ra2hpUHlLS0hHcFdaa2dBQm5EcE1NcUs2dDlfbUVPOVFaRlc4a3FHc1lxQ293d1E2UndIYnZxSXRlMVZrSUp5RjYxUlFR\u0026hl=en\u0026ec=66429","rootVe":83769}},"signInEndpoint":{"nextEndpoint":{"clickTrackingParams":"CJMBEP2GBCITCOfHuMO6pOkCFQ6yewodFyMBlw==","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=t
